import React from 'react';
import {Button} from 'antd';
import QueueAnim from 'rc-queue-anim';
import 'antd/dist/antd.css';
export default class Login extends React.Component{
    getInitialState(){
        return {
            show : false
        }
    }

    constructor(props){
        super(props);
        this.setState({
            show : false
        })
    }

     onChange() {
        this.setState({
            show : !this.state.show
        })
    }

    render(){
        return(
            <div>
                <Button type="primary" onClick={this.onChange}>show</Button>
                <QueueAnim className="demo-kp" key="demo"
                    type={['right','left']}
                    ease={['easeOutQuart','easeInQuart']}   
                >
                    {this.state.show?[
                        <div>
                            <ul>
                                <li>haha</li>
                                <li>lala</li>
                                <li>kaka</li>
                            </ul>
                        </div>
                    ]:null}
                </QueueAnim>
            </div>
        )
    }
}
